pr_body:
@romain-fontugne sir, I have added the logo on the top right corner as you suggested this closes #21 . Personally, I believe it to be a good placement of the branding. I even tried for a watermark by reducing the opacity of the logo but it reduced the visibility of the graph and its data points. 

When I tried putting the SVG you have told me to use it didn't show up. Thus, I moved forward with png and used [Cloudinary](https://cloudinary.com/) to host the static asset. As per my understanding using this particular CDN would increase the response rate and hence increase user retention. In case you don't want to use Cloudinary I have added the png file in the `src/assets/imgs` directory, so that we may use that as well in case of requirement in the future. But, I request to add all the static assets to any such asset management service. In case you want me to do that let me know I would add all the static assets to Cloudinary and then use links to fetch them, this would also act as a load balancer. 

I am attaching the current UI of the graph, let me know if you need any changes.

![ihr_logo_added](https://user-images.githubusercontent.com/67703407/158411000-bef192a1-ef6f-485e-a47b-958222640965.png)


@romain-fontugne sir, it would be great if we can host the website for dev in Netlify or Vercel, because their Github bots will help the maintainer check if the code is breaking in prod with their awesome CI/CD tooling feature. Even, would help the contributor understand if his/her code breaks somewhere something. In case you want me to add that let me know would be more than happy to work on that! 

PS. There was some issue in code formatting and the code looked a bit messy so I have created an issue `30` and I will be sending the PR shortly
